// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

contract Verificacio{

    //1. Elements del contracte

    // Primer identifiquem el propietari del document
    address private propietari;

    // Nom del document
    string private filename;

    // Validadors del document
    address[] private validadors;
    // No validadors del document
    address[] private denegadors;

    // Mapa de comprovació de les validacions amb un comentari
    mapping (address=>bool) private validacions;
    // Mapa de comprovació de les denegacions amb un comentari
    mapping (address=>bool) private denegacions;


    //2. CONSTRUCTOR
    event OwnerSet(address indexed propietari, string asset);
    
    constructor(string memory _filename) {
        propietari = msg.sender;
        filename = _filename;

        emit OwnerSet(propietari, filename);
    }

    //3. VALIDAR
    event Validation(address indexed validador, string asset);

    function validarDocument() public {
        require(propietari != msg.sender, "El propietari no pot validar el seu asset");
        require(!validacions[msg.sender], "Validador repetit");
        require(!denegacions[msg.sender], "No pots validar i denegar alhora");
        validadors.push(msg.sender);
        validacions[msg.sender] = true;

        emit Validation(msg.sender, filename);

    }

    //4. DENEGAR
    event Denegation(address indexed denegador, string asset);

    function denegarDocument() public {
        require(propietari != msg.sender, "El propietari no pot validar el seu asset");
        require(!denegacions[msg.sender], "Denegador repetit");
        require(!validacions[msg.sender], "No pots validar i denegar alhora");
        denegadors.push(msg.sender);
        denegacions[msg.sender] = true;

        emit Denegation(msg.sender, filename);

    }



    //Getters
    function haValidat(address _user) public view returns(bool) {
        require(propietari != _user);
        return validacions[_user];
    }

    function haDenegat(address _user) public view returns(bool) {
        require(propietari != _user);
        return denegacions[_user];
    }

    function getOwner() public view returns(address){
        return propietari;
    }

    function getFilename() public view returns(string memory){
        return filename;
    }

    function getNumberOfValidations() public view returns(uint256) {
        return validadors.length;
    }

    function getNumberOfDenegations() public view returns(uint256) {
        return denegadors.length;
    }

    //PROBLEMES
    /*
    1. No comprova si existeix realment o no el document
    2. No se sap si pot ser una copia o no
    3. Els verificadors poden mentir i fer un engany
    
    */

    


}

